import { AuthCtx } from "./Task8";

function CompB() {
  const { setCounter, Counter } = useContext(null);

  const handleDecrease = (e) => {
    e.preventDefault();
    setCounter(Counter + 10);
  };
  return (
    <div>
      <h4>CompB</h4>
      <button onClick={handleDecrease}>Decrease</button>
    </div>
  );
}

export default CompB;
